import React from 'react';
import Navbar1 from './Navbar';
const Attendence = () => {
    return (
        <>
        <Navbar1></Navbar1>
        {/* marking attendence on todays note */}
        <div className="container">
            <h1>Attendence</h1>
            <form>
                <div className="form-group">
                    <label htmlFor="name">Name</label>
                    <input type="text" className="form-control" id="name" />
                </div>
                <div className="form-group">
                    <label htmlFor="rollno">Roll No</label>
                    <input type="text" className="form-control" id="rollno" />
                </div>
                <div className="form-group">
                    <label htmlFor="attendence">Attendence</label> <br/>
                   <input type='radio' className="btn btn-primary"/>Present  <br/>
                   <button type='radio' className="btn btn-primary"/>Absent <br/>
                </div>
                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
        </div>
        </>
    );
};

export default Attendence;
